<script lang="js">
import Vue from "vue";
import isMobile from "@/helper/platform";

const buttonSideBar = `<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-menu"><line x1="3" y1="12" x2="21" y2="12"></line><line x1="3" y1="6" x2="21" y2="6"></line><line x1="3" y1="18" x2="21" y2="18"></line></svg>`
Vue.directive('click-outside', {
  bind: function (el, binding, vnode) {
    el.clickOutsideEvent = function (event) {
      if (!(el === event.target || el.contains(event.target) || event.target.outerHTML === buttonSideBar)) {
        vnode.context[binding.expression](event);
      }
    };
    document.body.addEventListener('click', el.clickOutsideEvent)
  },
  unbind: function (el) {
    document.body.removeEventListener('click', el.clickOutsideEvent)
  },
});


export default Vue.extend({
  data() {
    return {
      isShowSideBar: !isMobile(),
      subMenuActive: "",
    };
  },
  mounted() {
    this.$eventBus.$on("showSideBar", () => {
      this.showSideBar();
    });
    this.subMenuActive = this.$route.matched[0].name;
  },
  destroyed() {
    this.$eventBus.$off("showSideBar");
  },
  methods: {
    showSideBar() {
      this.isShowSideBar = !this.isShowSideBar;
    },
    clickOutSideEvent() {
      if (isMobile()) {
        this.showSideBar();
      }
    },
  },
  computed: {},
});
</script>

